import useFetch from './hooks/Header'
const test =  {
    "data": {
    "id": 1,
    "attributes": {
    "Title": "One more friend Thousands more fun!",
    "SubTitle": "Having a pet means you have more joy, a new friend, a happy person who will always be with you to have fun. We have 200+ different pets that can meet your needs!",
    "createdAt": "2023-01-23T16:24:37.132Z",
    "updatedAt": "2023-01-23T16:25:24.594Z",
    "publishedAt": "2023-01-23T16:24:43.997Z"
    }
    },
}
function App() {
  const {loding, error, data } = useFetch('http://localhost:1337/api/home?populate=*')

  if (loding) return <p>loading...</p>
  if (error) return <p> Error</p>
  console.log(data);
  return (
    <div>
      {test.map((t, index) => {

          {t.map(data)}

      })}
    </div>
  );
}

export default App;
